public class CorePacketListenerStatus implements PacketListener {

	private final ConnectionHandler handler;
	
	String jString = "{\"version\":{\"name\":\"" + CoreProtocolAdapter.VERSION_STRING
			+ "\",\"protocol\":" + CoreProtocolAdapter.VERSION
			+ "},\"players\":{\"max\":" + 25565
			+ ",\"online\":" + 42 
			+ ",\"sample\":[{\"name\":\" \",\"id\":\"78d8d567-42a2-4a2f-a2ac-60d9c20dcd82\"},{\"name\":\"§c§lCraft§9§lUnion §7Gaming Revolution\",\"id\":\"27e6f8e4-e82b-42c7-9871-1c4ea2ea4d1a\"},{\"name\":\"§7TS3 §8» §9ts.craftunion.org\",\"id\":\"a8716ea7-aaae-497f-ae03-0c7373a3818d\"},{\"name\":\"§7Twitter §8» §9@CraftUnion_EU\",\"id\":\"188d8c78-74b5-4a61-aad7-94dc17dcc4cc\"},{\"name\":\"§7Discord §8» §9https://discord.gg/7Dq3KWe\",\"id\":\"e5d21dd7-f48b-439c-841f-8cb0a818c8db\"},{\"name\":\" \",\"id\":\"a28aee55-f7d7-4803-880e-d40b839d6a91\"}]},\"description\":{\"extra\":[{\"text\":\"                    \"},{\"color\":\"red\",\"bold\":true,\"text\":\"Craft\"},{\"color\":\"blue\",\"bold\":true,\"text\":\"Union                \"},{\"color\":\"dark_gray\",\"text\":\"[\"},{\"color\":\"aqua\",\"text\":\"1\"},{\"color\":\"gray\",\"text\":\".\"},{\"color\":\"aqua\",\"text\":\"16\"},{\"color\":\"gray\",\"text\":\".\"},{\"color\":\"aqua\",\"text\":\"5\"},{\"color\":\"dark_gray\",\"text\":\"]\\n                  \"},{\"color\":\"gray\",\"text\":\"Gaming Revolution\"}],\"text\":\"\"},\"favicon\":\"data:image/png;base64,\\u003d\\u003d\",\"modinfo\":{\"type\":\"FML\",\"modList\":[]}}\r\n";
	
	public CorePacketListenerStatus(ConnectionHandler handler) {
		this.handler = handler;
	}
	
	@Override
	public void handlePacket(Packet packet) {
		if (packet.getID() == 0) {
			handler.sendPacket(new CorePacketOutResponse(jString));
		} else if (packet.getID() == 1) {
			PacketInPing ping = (PacketInPing) packet;
			handler.sendPacket(new CorePacketOutPong(ping.getPing()));
		}
	}

	@Override
	public void handleUnregister() {}

}
